// SPDX-License-Identifier: UNLICENSIED
pragma solidity >=0.8.2 <0.9.0;

//import "@openzeppelin/contracts/utils/Counters.sol";
// import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/utils/Counters.sol";


contract Vote {
    using Counters for Counters.Counter;
    Counters.Counter private sessionCounter;
//projets et sessions de votes
    struct Projet {
        string nom;
        string description;
        Counters.Counter voteCounter;

    }

    enum Etat{
        pending,
        encours,
        past
    }

    struct Session {
        uint256 debut;
        uint256 fin;
        Counters.Counter projectCounter;
        mapping(uint256 => Projet)  pro;
        Etat state;
    }

    // Mapping pour les sessions
    mapping(uint256 => Session) public sessions;
    uint256 public totalSessions;

    // Modificateur pour vérifier l'état de la session
    modifier inProgress() {
        require(
            sessions[totalSessions].debut < block.timestamp &&
            sessions[totalSessions].fin > block.timestamp,
            "Ce n'est pas encore l'heure"
        );
        _;
    }
    modifier past() {
        require(
            sessions[totalSessions].state== Etat.past,
            "la session actuelle est encore en cours"
        );
        _;
    }
     modifier isPending() {
        require(
            sessions[totalSessions].state== Etat.pending,
            "la session actuelle est encore en cours"
        );
        _;
    }

    // Fonction pour ajouter une session
    function addSession(uint256 _debut, uint256 _fin) isAdmin past public {
        require(_debut < _fin, "Intervalle invalide");

        // Initialiser la session
        Session storage session = sessions[totalSessions];
        session.debut = _debut; 
        session.fin = _fin;
        session.state = Etat.pending;

        sessionCounter.increment();
        totalSessions = sessionCounter.current();
    }

    // Fonction pour mettre à jour l'état de la session
    function updateSessionState() isPending isAdmin public {
        Session storage session = sessions[totalSessions-1];
        if (session.debut <= block.timestamp && session.fin >= block.timestamp) {
            session.state = Etat.encours;
        } else if (session.fin < block.timestamp) {
            session.state = Etat.past;
        }
    }

    // Fonction pour ajouter un projet
    function addProject(string memory _nom, string memory _description) isAdmin isPending public  {
        Session storage session = sessions[totalSessions-1];
        uint256 currentProjectId = session.projectCounter.current();
        session.pro[currentProjectId].nom=_nom;
        session.pro[currentProjectId].description=_description;
        session.pro[currentProjectId].voteCounter.current();
        session.projectCounter.increment();
    }

    // Fonction pour obtenir l'état de la session
    function getSessionState() public view returns (Etat) {
        return sessions[totalSessions].state;
    }
    // Fonction pour obtenir un projet par ID
    function getProject(uint256 projectId,uint256 sessionId) public  view returns (string memory nom, string memory description) {
        Session storage session = sessions[sessionId];
        Projet storage projet = session.pro[projectId];
        return (projet.nom, projet.description);
    }
    // Fonction pour obtenir les projets d'une session
    function getProjects(uint256 sessionId) public view returns (Projet[] memory) {
        Session storage session = sessions[sessionId];
        uint256 projectCount = session.projectCounter.current();
        Projet[] memory projets = new Projet[](projectCount);

        for (uint256 i = 0; i < projectCount; i++) {
            projets[i] = session.pro[i];
        }

        return projets;
    }
    //fonction pour mettre à jour une session
    function updateSession(uint256 _id,uint256 _debut, uint256 _fin) isPending isAdmin public{
        require(_debut < _fin, "Intervalle invalide");

        // Initialiser la session
        Session storage session = sessions[_id];
        session.debut = _debut; 
        session.fin = _fin;
        session.state = Etat.pending;
    }
    //fonction pour mettre à jour un projet d'une session
    function updateProject(uint256 _id,string memory _nom, string memory _description) isPending isAdmin public{
        Session storage session = sessions[totalSessions-1];
        session.pro[_id].nom =_nom;
        session.pro[_id].nom= _description;
    }
    //enregistrement des votants
    enum Poste{
        Admin,
        Lambda
    }
    enum StatutMember{
        Actif,
        Ancien
    }
    //1- enregistrement des membres de l'ong
    struct Member{
        string nom;
        string prenom;
        Poste poste;
        address clef;
        bool voter;
        StatutMember statut;
    }
    Counters.Counter private memberCounter;

    //liste des membres de l'ONG
    mapping(address=>Member) public members;
    //liste de ceux ayant voté
    mapping(address=>bool) public voted;
    //verifi s'il est un membre 
    modifier isMembre(){
        require(members[msg.sender].clef!=address(0),"vous n'avez plus le droit de voter");
        _;
    }
    //verifie si un membre est actif
    modifier isActive(){
        require(members[msg.sender].statut==StatutMember.Actif,"vous n'avez plus le droit de voter");
        _;
    }
     modifier isNotActive(){
        require(members[msg.sender].statut==StatutMember.Ancien,"vous n'avez plus le droit de voter");
        _;
    }
    //verifie si un membre est un admin
    modifier isAdmin(){
        require(members[msg.sender].poste==Poste.Admin,"acces interdit");
        _;
    }
    //verifie si un membre est inscrit sur une liste electorale
    modifier isVoter(){
        require(members[msg.sender].poste==Poste.Admin,"acces interdit");
        _;
    }
    //verifie si un membre a déjà voté
    modifier haVoted(){
        require(voted[msg.sender]=false,"deja vote");
        _;
    }
    //desactiver un membre
    function desactive(address _member) isMembre isActive  public{
        members[_member].statut=StatutMember.Ancien;
    }
    //resactiver un membre
    function reactive(address _member) isMembre isNotActive  public{
        members[_member].statut=StatutMember.Actif;
    }
    //ajout d'un membre
    function addMember(string memory  _nom,string memory _prenom,Poste _poste,address  _clef) isAdmin public {
        members[_clef]=Member(_nom,_prenom,_poste,_clef,false,StatutMember.Actif);
    }
    //inscription sur la liste electorale
    function inscription() isMembre isActive isPending public{
        members[msg.sender].voter=true;
    }
    //systeme de vote
    //fonction qui permet de voter pour un projet
    function voting(uint256 _id) isMembre isActive isVoter haVoted inProgress public {
        Session storage session = sessions[totalSessions-1];
        session.pro[_id].voteCounter.increment();
        voted[msg.sender]=true;
    }
    //fonction pour compter les votes
    // function resultats() public return (mapping (string=> )){

    // }




}

